import React, { Component } from 'react';
import Paragraph from './components/Paragraph';
import Title from './components/Title';

class App extends Component {
  render() {
    return (
      <div>
        <h1>Belajar React JS</h1>
        <Paragraph></Paragraph>
      </div>
    );
  }
}

export default App;
